import React from "react";
import Jumbotron from "./Jumbotron";
import Accordion from "./Accordion";
import Footer from "../Footer";
import homeCarousel from "./Carousel";

function Home() {
    return <>
        <div className="wrapper">
            <homeCarousel />
            <div className="container">
                <Jumbotron />
                <Accordion />
            </div>
        </div>
        <Footer />
    </>
}

export default Home;
